import React from 'react';
import { makeStyles } from '@material-ui/core/styles'
import {ListItem, ListItemIcon, ListItemText, ListSubheader, Collapse, List} from '@material-ui/core'
import {ExpandLess, ExpandMore} from '@material-ui/icons'

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
  nested: {
    paddingLeft: theme.spacing(4),
  },
}));

export default function MainListItems() {
    const classes = useStyles();
    const [open, setOpen] = React.useState(true);

    const handleClick = () => {
      setOpen(!open);
    }
    return(
    <div>
        <ListItem button>
            <ListItemText primary='Module1'/>
        </ListItem>
        <ListItem button>
            <ListItemText primary='Module2'/>
        </ListItem>
        <ListItem button>
            <ListItemText primary='Module3'/>
        </ListItem>
        <ListItem button>
            <ListItemText primary='Module4'/>
        </ListItem>
        <ListItem button>
            <ListItemText primary='Module5'/>
        </ListItem>
      <ListItem button onClick={handleClick}>
        <ListItemText primary="Inbox" />
        {open ? <ExpandLess /> : <ExpandMore />}
      </ListItem>
      <Collapse in={open} timeout="auto" unmountOnExit>
        <List component="div" disablePadding>
          <ListItem button className={classes.nested}>
            <ListItemText primary="Starred" />
          </ListItem>
        </List>
      </Collapse>
    </div>
    )
}
